Verenigde Staten
Drama / Oorlog
137 minuten

goed

met Daniel Craig, Liev Schreiber en Jamie Bell

Vier Joodse broers ontsnappen uit het door de Nazi's bezette Polen. Zij vluchten richting Wit-Rusland, waar zij zich aansluiten 
bij Russische verzetsstrijders en beginnen met het bouwen van een degelijke uitvalsbasis, die als bescherming moet dienen voor 
hen zelf en voor allen die in gevaar verkeren.
